import React from 'react';

function All() {
    const [all, setAll] = React.useState([]);

    React.useEffect(() => {
        fetch(`${process.env.REACT_APP_SERVER_URL}teachers/`)
            .then(res => res.json())
            .then(data => setAll(data))

        console.log(all)
    }, [])

    return <div>
        {all.forEach(guest => { return <p>{guest.name}</p> })}
    </div>
}


export default All;
